import Dashboard from "./components/Dashboard";

const isAuthenticated = !!localStorage.getItem("")

export default function() {
  return (
      <BrowserRouter>
      <Routes>
        <Route path="/" element={
            <Login />}
        />
        <Route path="/dashboard" element={

            <Dashboard />}
        />
      </Routes>
    </BrowserRouter>
  );
}
